import { AppBar,Toolbar,styled} from '@mui/material';

const Header =styled(AppBar)`
background:#000000;
`;






const NavBar = () =>{
    return (
        <Head>
            <Toolbar>
                <p>GDSC project</p>
                <p>All Users</p>
                <p>Add Users</p>

            </Toolbar>
        </Head>
    )
}

export default NavBar;
